import React from "react";
import ReactDOM from "react-dom/client";

import {BrowserRouter, Routes, Route} from "react-router-dom";

import Layout               from "./pages/Layout";
import ItemListContainer    from "./components/ItemListContainer";
import ItemDetailContainer  from "./components/ItemDetailContainer";
import Item                 from "./pages/Item";

import "./App.css";

const container = document.querySelector("#root");
const root = ReactDOM.createRoot(container);

function App() {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/home" element={<Layout/>}>
                    <Route index path=""        element={<ItemListContainer msg="Catalogo"/>}/>
                    <Route path="favoritos"     element={<Item msg="Favoritos"/>}/>
                    <Route path="carrito"       element={<Item msg="Carrito"/>}/>
                    <Route path="login"         element={<Item msg="Iniciar sesiÃ³n"/>}/>
                    <Route path="register"      element={<Item msg="Registrarse"/>}/>
                    <Route path="ItemDetailContainer"      element={<Item msg="Registrarse"/>}/>
                    <Route path="*"             element={<Item msg="Error 404"/>}/>
                </Route>
            </Routes>
        </BrowserRouter>
    )
}

root.render(<App/>)
